// 在 JS 中配置首页地址，作用是 给 location.href 跳转
S.data.indexpage = '/view/index.html'
// 存储用户信息
S.data.renderData = {
    isLogin: false
}


seajs.use(['$', 'handlebars' ,'querystring'], function ($, Handlebars, queryString) {

// 配合 mehotd.link 的记住当前页跳转
S.method.rememberthislink = function (path) {
    location.href = path + '?pathname=' + location.pathname + '&search=' + JSON.stringify(queryString.parse(location.search))
}

// 一个跳转链接控制器
// 默认跳转到首页
// 如果在 GET 参数中存在 pathname search 属性，则跳转到 对应的地址 属性
// 如果传入参数 {type: 'back'} 则返回上一页，如果不存在上一页则跳转到首页
S.method.link = function (settings) {
    settings = settings || {}
    var query = queryString.parse(location.search)
    // 此处做一个约定，GET参数中的 back_link 作为来源页标识和登录注册成功后的跳转页

    if (query.pathname) {
        location.href = query.pathname + '?' + queryString.stringify(JSON.parse(query.search || '{}'))
        // /view/login.html?pathname=/sd/&search={"a":1}
        // goto
        // /sd/?a=1
    }
    else {
        // 先尝试返回 | 传入 type back 才返回上一页
        if (settings.type === 'back') {
            history.back()
        }
        // 返回失败跳转至首页
        location.href = S.data.indexpage
    }
    return false
}



$(function () {

    if (S.SERVER.USER.id) {
        S.data.renderData.isLogin = true
    }

    // 如果存在 #user-header 则渲染用户信息和点击 “发现” 弹出导航
    var $header = $("#user-header")
    if ($header.length !== 0) {
        var findMaskTpl = __inline('hbs/findMask.handlebars')
        var $findMask = $(findMaskTpl())
        $findMask.on('scroll', function (event) {
            event.stopPropagation()
        })
        $findMask.appendTo('body')

        // 导航模板
        // 所有导航都是通过 <script src="/ajax/user.php"></script> 获取到用户信息，然后 handlebars 渲染页面
        // S.SERVER = {"USER":{"name":"nimo","id":2,"email":"mail@qq.com","avatar":"/dist/img/logo.png","_avatar":"用户头像"}}
        var handerTpl = __inline('hbs/header.handlebars')
        $header.html(
            handerTpl(S.SERVER)
        )
         // 显示弹出层
        $header.find('#findDialog').on('click', function () {
            $findMask.stop(false, true).animate({
                top:0
            })
        })
        // 隐藏弹出层
        $findMask.find('#closeDialog').on('click', function () {
            $findMask.stop(false, true).animate({
                top:'-200%'
            })
        })

    }
    var $html = $('html')
    // 防止AJAX加载缓慢默认有一个 loading 图片
    $html.removeClass('ui-loading-html')
    $('.s-back-link').on('click', function () {
        S.method.link({
            type: 'back'
        })
    })
})
})
